import React from 'react'
import {Switch, Route} from 'react-router-dom'
import Home from "./Home";
import Contact from "./Contact";
import About from "./About";
import Service from "./Service";

const App = () => {
    return (
        <>
            <Switch>
                <Route path='/' component={Home}>Home</Route>
            </Switch>
        </>
    );
}

export default App;
